        1.10.1 2016-04-07"},"preferredWeight":6,"contents":{"":{"contentType":"1","lastModified":1518716329000,"length":1591,"bytes":"<p>\nSixty
        people were killed, more\nthan 7,000 injured, 20,000 homeless and more than
        40,000\nbuildings damaged in Los Angeles, Ventura, Orange and San\nBernardino
        Counties. Severe damage occurred in the San Fernando\nValley: maximum intensities
        of (IX) were observed in and near\nNorthridge and in Sherman Oaks. Lesser,
        but still significant\ndamage occurred at Fillmore, Glendale, Santa Clarita,
        Santa\nMonica, Simi Valley and in western and central Los Angeles.\nDamage
        was also sustained to Anaheim Stadium. Collapsed\noverpasses closed sections
        of the Santa Monica Freeway, the\nAntelope Valley Freeway, the Simi Valley
        Freeway and the Golden\nState Freeway. Fires caused additional damage in the
        San\nFernando Valley and at Malibu and Venice. Preliminary estimates\nof damage
        are between 13 and 20 billion U.S. dollars. Felt\nthroughout much of southern
        California and as far away as\nTurlock, California; Las Vegas, Nevada; Richfield,
        Utah and\nEnsenada, Mexico. The maximum recorded acceleration exceeded\n1.0g
        at several sites in the area with the largest value of\n1.8g recorded at Tarzana,
        about 7 km south of the epicenter. A\nmaximum uplift of about 15 cm occurred
        in the Santa Susana\nMountains and many rockslides occurred in mountain areas,\nblocking
        some roads. Some ground cracks were observed at\nGranada Hills and in Potrero
        Canyon. Some liquefaction occurred\nat Simi Valley and in some other parts
        of the Los Angeles\nBasin.\n</p>\n<p>\n<small>\nFrom <a href=\"http://earthquake.usgs.gov/earthquakes/eqarchives/significant/sig_1994.php\">Significant
        Earthquakes of the World 1994</a>.\n</small>\n</p>\n"}}}],"moment-tensor":[{"indexid":"49356471","indexTime":1423762943938,"id":"urn:usgs-product:us:moment-tensor:duputel011794B:1423758077000","type":"moment-tensor","code":"duputel011794B","source":"us","updateTime":1423758077000,"status":"UPDATE","properties":{"beachball-source":"duputel","depth":"30.5","derived-depth":"30.5","derived-eventtime":"1994-01-17T12:30:55.000Z","derived-latitude":"34.5100","derived-longitude":"-118.5400","derived-magnitude":"6.7","derived-magnitude-type":"Mww","evaluation-status":"reviewed","eventParametersPublicID":"quakeml:us.anss.org/eventParameters/011794B/1423783277","eventsource":"duputel","eventsourcecode":"011794b","eventtime":"1994-01-17T12:30:55.000Z","latitude":"34.5100","longitude":"-118.5400","n-axis-azimuth":"292","n-axis-length":"-200000000000000000","n-axis-plunge":"9","nodal-plane-1-dip":"46","nodal-plane-1-rake":"102","nodal-plane-1-strike":"121","nodal-plane-2-dip":"44","nodal-plane-2-rake":"76","nodal-plane-2-strike":"283","p-axis-azimuth":"202","p-axis-length":"-12000000000000000000","p-axis-plunge":"0","quakeml-publicid":"quakeml:us.anss.org/focalMechanism/011794B/Mww","review-status":"reviewed","scalar-moment":"12120000000000000000","sourcetime-duration":"26.0","t-axis-azimuth":"107","t-axis-length":"12000000000000000000","t-axis-plunge":"80","tensor-mpp":"-1613000000000000000","tensor-mrp":"-1977000000000000000","tensor-mrr":"11890000000000000000","tensor-mrt":"-436300000000000000","tensor-mtp":"4262000000000000000","tensor-mtt":"-10270000000000000000"},"preferredWeight":61,"contents":{"contents.xml":{"contentType":"application/xml","lastModified":1423762942000,"length":195,"url":"https://earthquake.usgs.gov/archive/product/moment-tensor/duputel011794B/us/1423758077000/contents.xml"},"quakeml.xml":{"contentType":"application/xml","lastModified":1423758077000,"length":5057,"url":"https://earthquake.usgs.gov/archive/product/moment-tensor/duputel011794B/us/14