        person killed and at least 208 people injured, 150 buildings severely damaged
        and 1,000 buildings moderately damaged in Napa County. At least 49 people
        injured, 10 buildings severely damaged and 34 buildings moderately damaged
        in Solano County. Minor damage to several roads and several water main and
        gas line breaks in Napa and Solano Counties. Electricity and water services
        disrupted in Napa, Solano and Sonoma Counties. Six fires occurred in Napa
        County destroying at least 4 buildings. At least 8 km of surface faulting
        with at least 46 cm of right-lateral and 15 cm vertical displacements observed.
