        people killed and about 40 buildings collapsed or severely damaged (VIII)
        at Paso Robles. At least 40 people injured in the Paso Robles-Templeton area.
        Buildings damaged and small fires occurred at Atascadero, Cambria and Morro
        Bay. Road damage was sustained on State Routes 41 and 46 between State Route
        1 and U.S. 101. Damage also occurred to the Templeton Road Bridge and to a
        bridge near Oceano. The airport at Oceano was closed due to cracks in the
        runway. More than 10,000 homes and businesses were without power in the Paso
        Robles area. Damage estimated at 300 million U.S. dollars. Felt (VIII) at
        Templeton; (VII) at Atascadero, Bradley, Cayucos, Grover Beach, Oceano, San
        Miguel and Shandon; (VI) at Arroyo Grande, Cambria, Creston, Guadalupe, Lockwood,
        Lompoc, Los Osos, Morro Bay, Nipomo, Pismo Beach, San Luis Obispo, San Simeon,
        Santa Margarita and Santa Maria; (V) at Avenal, Buellton, King City, Santa
        Inez, Solvang and Taft. Felt in much of central and southern California from
        Sacramento and Santa Rosa to San Diego and as far east as Carson City, Las
        Vegas and Reno, Nevada and at Bullhead City, Arizona. The maximum recorded
        acceleration was 0.5g horizontal motion and 0.3g vertical motion at Templeton.
        Landslides blocked several mountain passes in the Santa Lucia Mountains. Liquefaction
        was observed in the Oceano area."}}}],"moment-tensor":[{"indexid":"122836461","indexTime":1483559924259,"id":"urn:usgs-product:nc:moment-tensor:nc21323712_mt1:1483559921010","type":"moment-tensor","code":"nc21323712_mt1","source":"nc","updateTime":1483559921010,"status":"UPDATE","properties":{"beachball-source":"NC","beachball-type":"smi:nc.anss.org/momentTensor/TDMT","depth":"8.382","derived-depth":"8","derived-eventtime":"2003-12-22T19:15:56.240Z","derived-latitude":"35.7005005","derived-longitude":"-121.100502","derived-magnitude":"6.5","derived-magnitude-type":"Mw","evaluation-status":"reviewed","eventParametersPublicID":"quakeml:nc.anss.org/Event/NC/21323712#148355992101","eventsource":"nc","eventsourcecode":"21323712","eventtime":"2003-12-22T19:15:56.240Z","latitude":"35.7005","longitude":"-121.1005","n-axis-azimuth":"123.001","n-axis-length":"-4.610E+17","n-axis-plunge":"3.406","original-eventsource":"nc","original-eventsourcecode":"21323712","p-axis-azimuth":"32.484","p-axis-length":"-7.307E+18","p-axis-plunge":"8.627","percent-double-couple":"0.88","quakeml-publicid":"quakeml:nc.anss.org/Mec/NC/9319","review-status":"reviewed","scalar-moment":"7.539E+18","t-axis-azimuth":"234.352","t-axis-length":"7.768E+18","t-axis-plunge":"80.716","tensor-mpp":"-2.253E+18","tensor-mrp":"1.613E+18","tensor-mrr":"7.402E+18","tensor-mrt":"-1.617E+18","tensor-mtp":"2.931E+18","tensor-mtt":"-5.149E+18"},"preferredWeight":156,"contents":{"contents.xml":{"contentType":"application/xml","lastModified":1483559921000,"length":376,"url":"https://earthquake.usgs.gov/archive/product/moment-tensor/nc21323712_mt1/nc/1483559921010/contents.xml"},"nc21323712_mechanism.jpg":{"contentType":"image/jpeg","lastModified":1483559920000,"length":7499,"url":"https://earthquake.usgs.gov/archive/product/moment-tensor/nc21323712_mt1/nc/1483559921010/nc21323712_mechanism.jpg"},"nc21323712_vr.gif":{"contentType":"image/gif","lastModified":1483559918000,"length":447474,"url":"https://earthquake.